export interface CardProps {
    id: string,
    title: string,
    category: string,
    artist: string,
    likes: number,
    dislikes: number,
    onMoveTrack: () => void
    onLikeTrack: () => void
    onDislikeTrack: () => void
}

export function Card(props: CardProps) {
    return (
        <div>
            <strong>{props.title}</strong> by {props.artist}
            <label>{props.category}</label>
            <button onClick={() => props.onMoveTrack()}>^</button>
            <button onClick={() => props.onMoveTrack()}>v</button>
            <button onClick={() => props.onLikeTrack()}>like</button>
            <button onClick={() => props.onDislikeTrack()}>dislike</button>
        </div>
    )
}
